import "./NavbarStyles.css";
import React from "react";


const Nav =() => {
  return(
    <div className="navbar">

      <ul class="pages">
        <li></li>
      </ul>
    </div>
  )
}


function Navbar(){

    return (
      <>
      <nav className="navbar">
        <div className="nav-container">
          <Link to="/" className="navbar-logo">
            TRVL <i className="fab fa-typo3"/>
          </Link>
          </div>
      </nav>
      </>
    );
  }

export default Navbar;
